// HeroSection.js

import React from 'react';
import profile from "../src/assets/images/Azhar_Hussain_Buriro.jpg";
const HeroSection = () => {
  return (
   <>
   
    <div className='container'>
        <div className='row'>
        <div className='col col-sm-12  col-md-6 col-lg-6'>
          <h1> Hi, <u><i>Azhar Hussain Buriro</i></u> Here! </h1>  
            <h3>Experienced undergraduate software engineer with 6 months of industry experience
                    specializing in full stack Software Development.</h3>

           </div>
        <div className='col col-sm-12  col-md-6 col-lg-6'> </div>
        <img src ={profile} alt='Profile '/> 
        </div>

      </div>
   
   
   
   </>
   
   
   
  );
};

export default HeroSection;
